import { Navigate, NavLink, Route } from "react-router-dom"
import { useToken } from "../hooks/TokenContext"
import './Header.css'
import Login from "./Login"

function Header() {
    const [token] = useToken()
  return (
    <header id="top-bar">
      <div>
        <NavLink to="/">Inicio</NavLink>
        <NavLink to="/register">Registro</NavLink>
        <NavLink to="/list">Lista de tareas</NavLink>
        {token && <NavLink to="/service/:id/user">Nueva tarea</NavLink>}
        {!token && <button onChange={<Route path="/login" element={<Login />} />}>Iniciar Sesion</button>}
      </div>

    </header>
  )
}

export default Header
